function [xi,w]=ClenshawCurtisPoints1D(n)
%%CLENSHAWCURTISPOINTS1D Compute Clenshaw-Curtis quadrature points and
%          weights for integrating polynomials (or approximating integrals
%          of non-polynomials) over the range -1 to 1. n+1 points and
%          weights will be generated to obtain nth order polynomial
%          interpolation. Contrast with with GaussLegendrePoints1D, where 
%          n+1 points can integration all polynomials up to order 2*n+1
%          using n points. However, the Clenshaw-Curtis points perform
%          well with non-polynomial functions, so they are not necessarily
%          worse than Gauss-Legendre points.
%
%INPUTS: n The order of the polynomial approximation. n>=2.
%
%OUTPUTS: xi A 1X(n+1) vector containing the quadrature points.
%          w An (n+1)X1 vector of the weights associated with the
%            quadrature points. Note that these sum to 2, not 1, and are
%            all positive.
%
%The algorithm of [1] using an ifft to get the weights is implemented in
%this function. For n being a power of 2 that is <=2048, the points and
%weights have been pretabulated and are just read from the table.
%
%EXAMPLE:
%Here, we integrate x.^2.*exp(-x.^2-x/2) from -1 to 1 using the
%Clenshaw-Curtis quadrature points. We then compare the result to an
%analytic solution.
% [xi,w]=ClenshawCurtisPoints1D(20);
% f=@(x)(x.^2.*exp(-x.^2-x/2));
% numIntSol=sum(w'.*f(xi));
% analyticSol=(-12-20*exp(1)+9*exp(25/16)*sqrt(pi)*(erf(3/4)+erf(5/4)))/(32*exp(3/2));
% 
% relError=(numIntSol-analyticSol)/abs(analyticSol)
%One can see that the relative error is about 12 times eps(1), indicating
%that the agreement is good and the difference is probably finite precision
%errors.
%
%REFERENCES:
%[1] J. Waldvogel, "Fast construction of the Fejer and Clenshaw-Curtis
%    quadrature rules," BIT Numerical Mathematics, vol. 46, no. 1, pp. 195-
%    202, Mar. 2006.
%
%May 2018 David F. Crouse, Naval Research Laboratory, Washington D.C.
%(UNCLASSIFIED) DISTRIBUTION STATEMENT A. Approved for public release.

%The cubature points are from Equation 2.1. They are just cos(k*pi/n),
%where k=0:n.
if(mod(2048,n)==0)
    %If n>2048, then 2048 is returned, so we don't need to check.
    
    %Read the points from a table.
    xi=xiFromTable(n);
else
    xi=zeros(1,n+1);
    xi(1)=1;
    cosTheta=cos(pi/n);
    %A double-angle formula.
    cos2Theta=2*cosTheta^2-1;
    xi(2)=cosTheta;
    xi(3)=cos2Theta;
    %We use the Chebyshev method to fill in the rest of the values of
    %cos(k*pi/n), which are the points in x.
    for k=3:(n-1)
        xi(k+1)=2*cosTheta*xi(k-1+1)-xi(k-2+1);
    end
    %We know that cos(pi)=-1.
    xi(n+1)=-1;
end

if(nargout>1)
    if(mod(2048,n)==0)
        %If we have pretabulated the values.
        w=wFromTable(n);
    else    
        %We are creating v as in Equation 3.10
        n2Fix=fix(n/2);
        v=zeros(n,1);
        k=(0:1:(n2Fix-1));
        v(1:(n2Fix+1))=[2./(1-4*k.^2),(n-3)/(2*n2Fix-1)-1];
        startIdx=n2Fix+mod(n,2);
        v((n2Fix+2):n)=v(startIdx:-1:2);

        %Equation 2.6
        w0cc=1/(n^2-1+mod(n,2));

        %Equation 4.2
        g=zeros(n,1);
        g(1:(n2Fix+1))=-w0cc;
        g(n2Fix+1)=w0cc*((2-mod(n,2))*n-1);
        startIdx=n2Fix+mod(n,2);
        g((n2Fix+2):n)=g(startIdx:-1:2);
        w=zeros(n+1,1);
        w(1:n)=ifft(v+g);%Clenshaw-Curtis weights.
        w(n+1)=w0cc;
    end
end
end

